import React, { useEffect, useState } from "react";
import axios from "axios";
import "../Style/homeStyle.css";

const Header = () => {
  return (
    <header>
      <div className="logo">Logo</div>
      <nav>
        <ul>
          <li>
            <a href="#home">Početna</a>
          </li>
          <li>
            <a href="#favorite">Omiljeni tabovi</a>
          </li>
          <li>
            <a href="#archive">Arhiva tabova</a>
          </li>
          <li>
            <a href="#profile">Profil</a>
          </li>
          <li>
            <a href="#settings">Postavke</a>
          </li>
          <li>
            <a href="#news">Novosti</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

const Section = ({ id, title, description }) => {
  return (
    <section id={id} className="section">
      <div className="section-content">
        <h2>{title}</h2>
        <p>{description}</p>
        <a href={`#${id}`} className="button">
          Više informacija
        </a>
      </div>
    </section>
  );
};

const Footer = () => {
  return (
    <footer>
      <p>© 2023 TabTracker. Sva prava pridržana.</p>
      <p>
        <a href="#">Uvjeti korištenja</a> | <a href="#">Pravila privatnosti</a>{" "}
        | <a href="#">Kontakt</a> | <a href="#">O nama</a>
      </p>
    </footer>
  );
};

const Home = () => {
  const [sections, setSections] = useState([
    {
      id: "home",
      title: "Početna",
      description: "Opis početne stranice",
    },
    {
      id: "favorite",
      title: "Omiljeni tabovi",
      description: "Opis omiljenih tabova",
    },
    {
      id: "archive",
      title: "Arhiva tabova",
      description: "Opis arhive tabova",
    },
    {
      id: "profile",
      title: "Profil",
      description: "Opis profila",
    },
    {
      id: "settings",
      title: "Postavke",
      description: "Opis postavki",
    },
    {
      id: "news",
      title: "Novosti",
      description: "Opis novosti",
    },
  ]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          "http://example.com/api/sections" // Replace with the actual endpoint for fetching data
        );
        setSections(response.data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="Home">
      <Header />
      {sections.map((section) => (
        <Section
          key={section.id}
          id={section.id}
          title={section.title}
          description={section.description}
        />
      ))}
      <Footer />
    </div>
  );
};

export default Home;
